import { BrowserRouter as Router } from "react-router-dom";
import "./assets/fonts/roboto.scss";
import Routes from "./routes/PageRoutes";
import Center from "./components/center/Center";

function App() {
  return (
    <>
      <Center>
        <Router>
          <Routes />
        </Router>
      </Center>
    </>
  );
}

export default App;
